    display: flex;
    flex-direction: column;
`;

const FormContainer = styled.div`
    width: 400px;
    height: 70px;
    border-radius: 10px;
    background: white;
    box-shadow: 0 6px 30px -10px #d5dbed;
    margin-bottom: 10px;
    display: flex;
    justify-content: center;
    align-items: center;
`;

const FormTab = styled.div`
    width: 95%;
    background: transparent;
    height: 100%;
    display: flex;
    justify-content: space-between;
    align-items: center;
`

const SearchField = styled.div`
    width: 75%;
    height: 50px;
    background-color: #ECF1F4;
    border-radius: 6px;
`;

const SearchButton = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    text-transform: uppercase;
    cursor: pointer;
    width: 25%;
`

const RecentContainer = styled.div`

`;

const Search = () => {
    return(
        <Wrapper>
            <FormContainer>
                <FormTab>
                    <SearchField>
                    </SearchField>
                    <SearchButton>
                        <p>search</p>
                    </SearchButton>
                </FormTab>
            </FormContainer>
            <RecentContainer>

            </RecentContainer>
        </Wrapper>
    )
}

export default Search;
